/* layer_3_Relu*/
static float tensor_layer_3_Relu_output[THIRD_LAYER_SIZE_COL];


//node_layer_1_MatMul(tensor_input, tensor_layer_1_MatMul_weights, tensor_layer_1_MatMul_output)
static inline void node_layer_1_MatMul(const int A[INPUT_LAYER_SIZE_COL],
    int Y[INPUT_LAYER_SIZE_ROW])
{
    /* MatMul */
    for (uint32_t c = 0; c < INPUT_LAYER_SIZE_ROW; c++) {
        Y[c] = 0;
        for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
            Y[c] += BINARISE(A[c]) * BINARISE(tensor_layer_1_MatMul_weights[c][i]) + BINARISE(tensor_layer_1_Add_bias[c]);
        }
    }
}

static inline void node_layer_1_BN(const int Y[INPUT_LAYER_SIZE_ROW], float tensor_layer_1_BN_output[INPUT_LAYER_SIZE_ROW])
{
    for (unsigned i1 = 0; i1 < INPUT_LAYER_SIZE_ROW; i1++) {
        tensor_layer_1_BN_output[i1] = ((float)Y[i1] - tensor_layer_1_batch_mean[i1]) * tensor_layer_1_batch_var_modified[i1];
    }
}

static inline void node_layer_1_ReLU(const float tensor_layer_1_BN_output[INPUT_LAYER_SIZE_ROW], float tensor_layer_1_Relu_output[INPUT_LAYER_SIZE_ROW])
{
    for (unsigned i1 = 0; i1 < INPUT_LAYER_SIZE_ROW; i1++) {
        tensor_layer_1_Relu_output[i1] = RELU(tensor_layer_1_BN_output[i1]);
    }

}

static inline void node_layer_2_MatMul(const float A[SECOND_LAYER_SIZE_ROW],
    int Y[SECOND_LAYER_SIZE_ROW])
{
    /* MatMul */
    for (uint32_t c = 0; c < SECOND_LAYER_SIZE_ROW; c++) {
        Y[c] = 0;
        for (uint32_t i = 0; i < SECOND_LAYER_SIZE_COL; i++)
        {
            Y[c] += BINARISE(A[i]) * BINARISE(tensor_layer_2_MatMul_weights[c][i]) + BINARISE(tensor_layer_2_Add_bias[c]);
        }
    }
}

static inline void node_layer_2_BN(const int Y[SECOND_LAYER_SIZE_ROW], float tensor_layer_1_BN_output[SECOND_LAYER_SIZE_ROW])
{
    for (unsigned i1 = 0; i1 < SECOND_LAYER_SIZE_ROW; i1++) {
        tensor_layer_2_BN_output[i1] = ((float)Y[i1] - tensor_layer_2_batch_mean[i1]) * tensor_layer_2_batch_var_modified[i1];
    }

}

static inline void node_layer_2_ReLU(const float tensor_layer_2_BN_output[SECOND_LAYER_SIZE_ROW],
    float tensor_layer_2_Relu_output[SECOND_LAYER_SIZE_ROW])
{
    for (unsigned i1 = 0; i1 < SECOND_LAYER_SIZE_ROW; i1++) {
        tensor_layer_2_Relu_output[i1] = RELU(tensor_layer_2_BN_output[i1]);
    }

}

static inline void node_layer_3_MatMul(const float A[THIRD_LAYER_SIZE_ROW],
    int Y[THIRD_LAYER_SIZE_ROW])
{
    /* MatMul */
    for (uint32_t c = 0; c < THIRD_LAYER_SIZE_ROW; c++) {
        Y[c] = 0;
        for (uint32_t i = 0; i < THIRD_LAYER_SIZE_COL; i++)
        {
            Y[c] += BINARISE(A[i]) * BINARISE(tensor_layer_3_MatMul_weights[c][i]) + BINARISE(tensor_layer_3_Add_bias[c]);
        }
    }
}

static inline void node_layer_3_BN(const int Y[THIRD_LAYER_SIZE_ROW], float tensor_layer_1_BN_output[THIRD_LAYER_SIZE_ROW])
{
    for (unsigned i1 = 0; i1 < THIRD_LAYER_SIZE_ROW; i1++) {
        tensor_layer_3_BN_output[i1] = ((float)Y[i1] - tensor_layer_3_batch_mean[i1]) * tensor_layer_3_batch_var_modified[i1];
    }

}

static inline void node_layer_3_ReLU(const float tensor_layer_2_BN_output[THIRD_LAYER_SIZE_ROW],
    float tensor_layer_3_Relu_output[THIRD_LAYER_SIZE_ROW])
{
    for (unsigned i1 = 0; i1 < THIRD_LAYER_SIZE_ROW; i1++) {
        tensor_layer_3_Relu_output[i1] = RELU(tensor_layer_3_BN_output[i1]);
    }

}

static inline void node_layer_Sigmoid(const float tensor_layer_3_Relu_output[SECOND_LAYER_SIZE_ROW],
    float tensor_sigmoid_output[SECOND_LAYER_SIZE_ROW])
{
    for (unsigned i1 = 0; i1 < SECOND_LAYER_SIZE_ROW; i1++) {
        tensor_sigmoid_output[i1] = HARD_SIGMOID(tensor_layer_3_Relu_output[i1]);
    }
}

int main()
{
    int tensor_input[INPUT_LAYER_SIZE_COL];
    float tensor_output[INPUT_LAYER_SIZE_ROW];

    for (int i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
        tensor_input[i] = nondet_int();
        __ESBMC_assume((tensor_input[i] == -1) || (tensor_input[i] == 1));
    }

    node_layer_1_MatMul(tensor_input, tensor_layer_1_MatMul_output);
    node_layer_1_BN(tensor_layer_1_MatMul_output, tensor_layer_1_BN_output);
    node_layer_1_ReLU(tensor_layer_1_BN_output, tensor_layer_1_Relu_output);

    node_layer_2_MatMul(tensor_layer_1_Relu_output, tensor_layer_2_MatMul_output);
    node_layer_2_BN(tensor_layer_2_MatMul_output, tensor_layer_2_BN_output);
    node_layer_2_ReLU(tensor_layer_2_BN_output, tensor_layer_2_Relu_output);

    node_layer_3_MatMul(tensor_layer_2_Relu_output, tensor_layer_3_MatMul_output);
    node_layer_3_BN(tensor_layer_3_MatMul_output, tensor_layer_3_BN_output);
    node_layer_3_ReLU(tensor_layer_3_BN_output, tensor_layer_3_Relu_output);

    node_layer_Sigmoid(tensor_layer_3_Relu_output, tensor_output);

    for (int i = 0; i < INPUT_LAYER_SIZE_ROW; i++) {
        printf("tensor_output[%d]: %f\n", i, tensor_output[i]);
        __ESBMC_assert(tensor_output[i] >= 0, "");
        __ESBMC_assert(tensor_output[i] <= 1, "");
    }

    return 0;
}

